BATFXXX - Dark Night Parody [SPLIT SCENES]


The overrun, bleak dystopia of Gothard City has one stalwart protect: Bat Fuck. In his iconic cape and cowl, Billionaire Bruce defends the city from the scourge of crime. When the Joker steals Poison Ivy's latest carnal creation to unleash on the unsuspecting population, only the dashing crime-fighter and his trusty assistants Robina &amp; Bat Chick can save the day.

